import { Route } from "react-router-dom";
import Home from "./pages/Home";
import Away from "./pages/Away";
import Middle from "./pages/Middle";

function App() {
  return (
    <section>
      <h2> you here</h2>
      <Route path="/home">
        <Home />
      </Route>
      <Route path="/middle">
        <Middle />
      </Route>
      <Route path="/away">
        <Away />
      </Route>
    </section>
  );
}

export default App;
